script: |
  super -f text -I q12000.spq | sort > q12000.out

inputs:
  - name: q12000.spq
    data: |
      SELECT DISTINCT - 70 + - 32 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE ( - col1 + 99 + + - ( - col1 ) * + + col1 * + col0 ) NOT BETWEEN NULL AND - col1;
  - name: tab0

outputs:
  - name: q12000.out
    data: |
      -102
